GenPackageParagraph.create!([
  {text: "Seattle is a coastal seaport city and the seat of King County, in the U.S. state of Washington. With an estimated 652,405 residents as of 2013, Seattle is the largest city in both the State of Washington and the Pacific Northwest Region of North America and the fastest-growing major city in the United States.The Seattle metropolitan area of around 3.6 million inhabitants is the 15th largest metropolitan area in the United States.The city is situated on a narrow isthmus between Puget Sound (an inlet of the Pacific Ocean) and Lake Washington, about 100 miles south of the Canada–United States border. A major gateway for trade with Asia, Seattle is the 8th largest port in the United States and 9th largest in North America in terms of container handling.", image_file_name: nil, image_content_type: nil, image_file_size: nil, image_updated_at: nil, gen_package_id: 4},
  {text: "New York is a state in the Northeastern and Mid-Atlantic regions of the United States. New York is the 27th-most extensive, the third-most populous, and the seventh-most densely populated of the 50 United States. New York is bordered by New Jersey and Pennsylvania to the south and by Connecticut, Massachusetts, and Vermont to the east. The state has a maritime border with Rhode Island east of Long Island, as well as an international border with the Canadian provinces of Quebec to the north and Ontario To the west and north. The state of New York is often referred to as New York State to distinguish it from New York City, its largest city.", image_file_name: nil, image_content_type: nil, image_file_size: nil, image_updated_at: nil, gen_package_id: 3},
  {text: "Washington, D.C., formally the District of Columbia and commonly referred to as Washington, \"the District\", or simply D.C., is the capital of the United States. The signing of the Residence Act on July 16, 1790, approved the creation of a capital district located along the Potomac River on the country's East Coast. The U.S. Constitution provided for a federal district under the exclusive jurisdiction of the Congress and the District is therefore not a part of any U.S. state.", image_file_name: nil, image_content_type: nil, image_file_size: nil, image_updated_at: nil, gen_package_id: 6}
])
